import React, { Component } from "react";
import { Map } from "react-leaflet";

const DEFAULT_LANGITUDE = 14.610374;
const DEFAULT_LATITUDE = 40.782723;

class Maps extends Component {
  render() {
    return <Map center={[DEFAULT_LATITUDE, DEFAULT_LANGITUDE]}></Map>;
  }
}

export default GoogleApiWrapper({
  apiKey: "AIzaSyDiO2aRty30mt-6kQXd6feeNNb4YsQ7Qxs",
})(Maps);
